CREATE TABLE organization_data(
   organization_id           VARCHAR(36) NOT NULL PRIMARY KEY
  ,industry                  VARCHAR(34) NOT NULL
  ,has_foreign_founder       VARCHAR(5) NOT NULL
  ,has_us_founder            VARCHAR(5) NOT NULL
  ,company_structure         VARCHAR(23) NOT NULL
  ,venture_capital_investors VARCHAR(55)
  ,region_or_state           VARCHAR(2) NOT NULL
  ,country                   VARCHAR(2) NOT NULL
);
